-- Tabla para auditoria
CREATE TABLE audit (
    id IDENTITY PRIMARY KEY,
    id_peticion VARCHAR(255) NOT NULL,
    xml_peticion CLOB,
    xml_respuesta CLOB,
    estado VARCHAR(10) NOT NULL,
    mensaje_estado VARCHAR(255) NOT NULL,
    detalle_error VARCHAR(500),
    fecha_creacion TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    fecha_actualizacion TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    fecha_respuesta_prevista TIMESTAMP NOT NULL,
    fecha_disponible TIMESTAMP
);


CREATE TABLE async_peticion (
    id IDENTITY PRIMARY KEY,
    id_peticion VARCHAR(255) NOT NULL,
    xml_peticion CLOB,
    xml_respuesta CLOB,
    estado VARCHAR(20),
    ter INT
);




-- Volcando estructura para tabla itcard20db.alumnos
CREATE TABLE alumnos (
    dni VARCHAR(255) PRIMARY KEY,
    nombre VARCHAR(255),
    apellido1 VARCHAR(255),
    apellido2 VARCHAR(255),
    direccion VARCHAR(255),
    codigop VARCHAR(255),
    poblacion VARCHAR(255),
    provincia VARCHAR(255),
    telefono VARCHAR(255),
    email VARCHAR(255),
    edad DATE,
    sexo VARCHAR(255),
    ocupacion VARCHAR(255),
    anosti INT,
    displayname VARCHAR(255),
    maneraform INT,
    perpassword VARCHAR(255),
    id_provincias INT,
    idsexo INT,
    idsector INT,
    idPerfil INT,
    claveEmpresa VARCHAR(255),
    id_origen INT,
    preguntasecreta VARCHAR(255),
    respuestasecreta VARCHAR(255),
    erakundeIVAP VARCHAR(255),
    created TIMESTAMP,
    updated TIMESTAMP,
    agreeGDPR INT,
    activo INT,
    fecha_confirmacion TIMESTAMP
);


CREATE TABLE matricula (
    password VARCHAR(255) PRIMARY KEY,
    cod_centro INT,
    dni VARCHAR(255),
    cod_modulo INT,
    username VARCHAR(255),
    num_conv INT,
    fecha_matr DATE,
