    ip VARCHAR(255),
    id_status INT,
    prueba_cerrada INT,
    id_nivel INT,
    num_correctas INT,
    num_incorrectas INT,
    acg1 INT,
    acg2 INT,
    acg3 INT,
    comunicacion_alternativo INT,
    asistencia_especial INT,
    useragent VARCHAR(255),
    hora_inicio_examen VARCHAR(255),
    hora_fin_examen VARCHAR(255),
    examen_invidentes INT,
    activo INT,
    id_origen INT,
    idSesion VARCHAR(255),
    plataforma INT,
    viejaConvocatoria INT,
    resp1 VARCHAR(255),
    resp2 VARCHAR(255),
    resp3 VARCHAR(255),
    tiempo INT,
    created TIMESTAMP,
    updated TIMESTAMP,
    idioma VARCHAR(255)
);


